9','Azon trd a fejed, hogy vllalkozst indts, vagy akr mr vllalkoz vagy?\r\nVrod a nagy tletet, vagy akr mr munklkodsz is rajta?\r\nTricsillirdos akarsz lenni, vagy pp jobb akarod tenni a vilgot?\r\nTech szaki vagy s kne mg valaki, aki rt az zlethez vagy a dizjnhoz?\r\n\r\nSikeres vllalkozk s a magyar startup koszisztma szerepli osztjk meg a tapasztalataikat s meslnek arrl, hogy mivel jr vllalkoznak vagy startuppernek lenni.\r\n\r\nEbben a hnapban a vendgnk lesz:\r\n\r\nBogr Bence (a Kitchen Budapest startup divzijnak vezetje, TEDx eladst a http://bit.ly/bogarbence cmen nzheted meg)\r\nMajer Zoltn (a Central Computer s a Lali Papa dessgbolt alaptja, aki emellett civilben kzpiskolban osztlyfnk s Schimn videkban szerepel)\r\nBenedek Balzs (a Skawa Innovation alaptja, szmos magyar s nemzetkzi sikersztori rszese, pl. otthonrol.hu, ingyenhivo.hu, easyling.com stb.)\r\nA rvid eladsokat s krdezz-feleleket kapcsoldsi lehetsgek kvetik:\r\n\r\ntid lehet a sznpad 2 percre, elmondhatod, milyen tleted van, mire van szksged, milyen emberekkel kapcsoldnl szvesen\r\negy ktetlen srzs keretben folytathatod a beszlgetst az eladkkal s a tbbi rsztvevvel\r\nAz est hzigazdja P. Tth Andrs (Gymlcstrhely, Lthatatlan Egyetem, OpenMeetup, TEDx eladst a http://bit.ly/ptothandras_tedx cmen nzheted meg).\r\n\r\nGyere el a [Simonyi Colours] s a [Startup & Vllalkozs VndorMeetup] kvetkez llomsra, hogy megtedd a kvetkez lpst a vlllakozv vls fel s kzelebb juss az lmaid megvalstshoz!\r\n\r\nIdpont: 2012.10.29. htf 19:00\r\nHelyszn: Schnherz, Els emeleti nagyterem\r\n','2012-10-29 18:00:00','2012-10-29 21:00:00','2012-10-24 13:53:26','2012-11-16 12:02:32',32,2,'Budapest',47.4736,NULL,'Irnyi t 42.',19.0529,1,'otlettol-a-vallalkozasig-eloadas-beszelgetes-sorozes-2012-10-29','Schnherz Kollgium',NULL,NULL,'tlettl a vllalkozsig - elads, beszlgets, srzs - 2012.10.29'),(50,'Pilvax day #5','','2012-10-24 16:00:00','2012-10-24 20:00:00','2012-10-24 18:23:51','2012-11-16 12:02:32',31,163,'Budapest',47.4984,NULL,'K