omsra, hogy megtedd a kvetkez lpst a vlllakozv vls fel s kzelebb juss az lmaid megvalstshoz!\r\n\r\nIdpont: 2012.11.19. htf 19:00\r\nHelyszn: Schnherz Kollgium, Els emeleti nagyterem, Budapest 1111 Irnyi t 42.','2012-11-19 18:00:00','2012-11-19 22:00:00','2012-11-13 14:03:26','2012-11-21 10:40:18',32,2,NULL,47.4984,NULL,'Schnherz Kollgium, Els emeleti nagyterem, Budapest 1111 Irnyi t 42.',19.0408,1,'otlettol-a-vallalkozasig-eloadas-beszelgetes-sorozes-2012-11-19','Schnherz Kollgium, Els emeleti nagyterem',NULL,8,'schstartup'),(55,'Htrendezs 2012.12.09.','','2012-12-09 18:00:00','2012-12-09 21:00:00','2012-12-08 12:12:59','2012-12-08 12:12:59',7,2,NULL,47.4818,NULL,'Rday utca 58.',19.0671,1,'hetrendezes-2012-12-09','Jedermann Kvhz',NULL,0,''),(56,'Monthly Meetup','','2012-01-10 17:00:00','2012-01-10 20:00:00','2012-12-13 02:02:10','2012-12-13 02:02:10',39,276,NULL,42.0192,NULL,'Foundry Street',-71.1051,1,'monthly-meetup','The Round Foundry',NULL,NULL,'testrb'),(57,'Htrendezs 2012.12.16.','','2012-12-16 18:00:00','2012-12-16 21:00:00','2012-12-16 08:55:38','2012-12-16 08:55:38',7,2,NULL,47.4818,NULL,'Rday utca 58.',19.0671,1,'hetrendezes-2012-12-16','Jedermann Kvhz',NULL,0,''),(58,'From culture of death to life: a forum','Due to lack of interest this event has been cancelled -- to be rescheduled in the near future.\r\n\r\nAn open-ended community forum on examining the \"culture of death\" in American collective psyche and how it relates to recent incidents of mass active shootings.\r\n\r\nTuesday, January 15, 2013, 7-8:45 p.m. (Pacific Time) - note the change\r\n\r\n\r\nContact: Interfaith Solidarity Cascadia\r\nwww.interfaithsolidaritycascadia.tk\r\n\r\nTwitter @pdxintersol\r\nFacebook http://fb.me/opdxchaplains\r\nDiaspora* https://joindiaspora.com/u/interfaithsolidaritycascadia\r\nEmail pdxintersol=pacificwest.com (substitute equal with arrobe)\r\n','2013-01-15 18:00:00','2013-01-15 19:45:00','2013-01-02 06:53:48','2013-01-14 06:59:38',44,268,NULL,45.5201,NULL,'1131 SE OAK ST #5',-122.654,1,'from-culture-of-death-to-life-a-forum','cancelled / to be rescheduled TBA',NULL,240,''),(59,'Group: Women\'s spirituality and social change: Contribution of women\'s wisdom and spirituality to social transformation','An open-ended and nonsectarian discussion and study group on women\'s spirituality and its contribution to social and cultural transformation.  This is a three-week series (initially; may be extended by demand) on Sundays 6-8 p.m.  In order to keep the group consistent and small enough for an in-depth discussion and shared experiences, pre-registration is requested by no later than Wednesday, January 16.  The second and third meeting build on the previous ones.\r\n\r\nInformation/Registration (free): email pdxintersol=pacificwest.com (replace = symbol appropriately), or use the RSVP feature on Meetupedia.com. You will receive confirmation by email if you are officially signed up. \r\n\r\nInterfaith Solidarity Cascadia\r\nwww.interfaithsolidaritycascadia.tk','2013-01-20 17:00:00','2013-01-20 19:00:00','2013-01-02 07:24:49','2013-01-11 04:13:25',44,268,NULL,45.5201,NULL,'1131 SE OAK ST #5',-122.654,1,'group-women-s-spirituality-and-social-change-contribution-of-women-s-wisdom-and-spirituality-to-social-transformation','Che Room',NULL,240,''),(60,'Reuni de gener','txarrada per escoltar promesa el darrer estiu','2013-01-31 19:00:00','2013-01-31 22:00:00','2013-01-02 15:06:23','2013-01-02 15:07:14',45,292,NULL,41.0676,NULL,'Arag 236',1.06198,1,'reunio-de-gener','Mes Open Bar',NULL,NULL,'bcn-pmge13'),(61,'Vivian Maier killts','Fotkillts egy nemrg felfedezett letmbl. New York s Chicago street photography.\r\n\r\nhttp://www.maimano.hu/andrekerteszterem/20120621_vivianmaier/index.html\r\n\r\nfelntt: 1000 Ft, dik: 500 Ft','2013-01-03 16:00:00','2013-01-03 18:00:00','2013-01-02 17:18:02','2013-01-03 11:11:50',30,36,NULL,47.5035,NULL,'1065 Budapest, Nagymez utca 20.',19.0599,1,'vivian-maier-kiallitas','Mai Man Hz',NULL,8,''),(62,'vrendezs','rviden:\r\n\r\n	vasrnap vrendezs este,\r\n	gyere, hozz tavalyi naptrat, j lesz.\r\n\r\n	* helyszn: Lthatatlan HQ, Pipa utca 2/b, 5-s kapucseng\r\n	* idpont: 2013. janur 6. vasrnap, rkezs 18:45-, kezds 19:05\r\n\r\n	--> http://doodle.com/kkkxuayi3gbp3u54\r\n\r\nbvebben:\r\n\r\n	ngy vvel ezeltt egy januri estn\r\n	azon trtem a fejem, hogy\r\n	vajon j irnyba tart-e az letem?\r\n	tartok-e egyltaln valahova?\r\n	s egyltaln, van-e beleszlsom, hogy hova tartok?\r\n\r\n	vgl leltem, s sszertam egy lapra, hogy\r\n	mi minden trtnt velem az elz vben.\r\n\r\n	milyen esemnyeken vettem rszt,\r\n	milyen fontos tallkozsoknak lehettem a rszese,\r\n	milyen nagyobb dntseket hoztam,\r\n	mi volt, ami lelkestett,\r\n	mit halogattam s mit szrtam el.\r\n\r\n	kt dologra jttem r:\r\n	egyrszt, hogy sokkal szuperebb letem van, mint gondoltam,\r\n	msrszt, hogy ezt mg lehetne fokozni :)\r\n\r\n	ezutn rszntam egy rt, hogy lerjam, hogy\r\n	mibl szeretnk tbbet,\r\n	mibl szeretnk kevesebbet,\r\n	milyennek kpzelem magam egy v mlva.\r\n\r\n	a kvetkez vben csuda dolgok trtntek.\r\n	nekilttam projekteknek, aminek korbban sosem mertem korbban nekifogni.\r\n	nemet mondtam olyan helyzetekben, ahol korbban\r\n	csak azrt mondtam igent, mert fogalmam sem volt, hogy mit mondjak.\r\n	korbban res, rtelmetlen dlutnok teltek meg\r\n	olyan tevkenysgekkel, amiktl fel tudtam tltdni.\r\n\r\n	azta minden vben rsznok egy estt, hogy\r\n	lezrjam az elz vet, s\r\n	gondolkodjak a kvetkezn.\r\n\r\n	ha van tavalyi naptrad, hozd el magaddal.\r\n	n hozok krdseket, amiken gondolkodhatsz.\r\n\r\n\r\nkrdsek s vlaszok:\r\n\r\n	nem lehetne tartani mg egyet, valamikor vizsgaidszak vgn?\r\n	\r\n		de, tartunk mgegyet vizsgaidszak vgn,\r\n		kldk majd levelet megint.\r\n\r\n	nem tudok menni, de el tudod kldeni a krdseket?\r\n	\r\n		persze, jv hten dobj egy emailt s kldm.\r\n\r\n	mennyi id ez?\r\n\r\n		amennyit rsznsz, tavaly \r\n		30 perc s 3 ra kztt volt a szintid :)\r\n\r\n\r\na lnyeg mgegyszer:\r\n	\r\n	* helyszn: Lthatatlan HQ, Pipa utca 2/b, 5-s kapucseng\r\n	* idpont: 2013. janur 6. vasrnap, rkezs 18:45-, kezds 19:05\r\n\r\n	--> http://doodle.com/kkkxuayi3gbp3u54\r\n\r\nandris\r\nLthatatlan Egyetem\r\n--','2013-01-06 18:00:00','2013-01-06 21:00:00','2013-01-05 16:15:19','2013-01-05 16:15:50',7,2,NULL,NULL,NULL,'Pipa utca 2/b, 5-s kapucseng',NULL,NULL,'evrendezes','Lthatatlan HQ',NULL,NULL,''),(63,'rencontre','essai','2013-01-10 18:00:00','2013-01-10 21:00:00','2013-01-10 04:53:46','2013-01-10 04:53:46',48,303,NULL,45.5087,NULL,'bla',-73.554,1,'rencontre','saint sulpice',NULL,174,''),(64,'Htrendezs 2013.01.13.','','2013-01-13 18:00:00','2013-01-13 21:00:00','2013-01-12 18:25:28','2013-01-12 18:25:28',7,2,NULL,47.4818,NULL,'Rday utca 58.',19.0672,1,'hetrendezes-2013-01-13','Jedermann Kvhz',NULL,0,'');
