INSERT INTO `groups` VALUES (7,'Eckermann klub','Egy pohr tea, egy res papr, pr ra gondolkods, s egy szp rendezett ht.','Budapest','2012-03-02 09:37:12','2012-11-16 12:21:18',2,'eckermann-klub','groups_7.jpg',32371,'image/jpeg',0,'2012-04-06 07:42:28','','','',1,8,'2012-08-24 08:56:46',374726,'image/png','Screen_Shot_2012-08-24_at_Aug_24__10.55.35_AM.png',9,'eckermann-klub',NULL),(12,'Trzsfnkk asztaltrsasga','Kzssgek vezetinek tallkozja, tapasztalatcsere.','Budapest','2012-03-02 09:58:39','2012-05-02 10:10:17',2,'torzsfonokok-asztaltarsasaga','groups_12.jpg',241891,'image/jpeg',0,'2012-04-06 07:44:02',NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,3,NULL,NULL),(14,'Trk Budapest krnykn','Trzs Budapest krnykn, 20-35 v kzttieknek.','Budapest','2012-03-02 10:00:44','2012-08-24 07:25:49',2,'turak-budapest-kornyeken','groups_14.png',80943,'image/png',0,'2012-04-06 07:44:23','','','',1,8,NULL,NULL,NULL,NULL,2,NULL,NULL),(30,'Hegeli Dialektika','**Egy barti trsasg hasonszr, mvszetkedvel, kellkppen laikus, mde mvelt fiataloknak, hogy egyrszt tudj arrl, hogy hov rdemes menni Budapesten, ha kultrra szomjazol, msrszrl legyen kivel elmenned.**\r\n\r\nItt az esemnyeket szervezzk. Ha van egy killts, elads, film, vagy gurmsg, amire szvesen mennl s hvnl msokat is, akkor csak hozz ltre egy j esemnyt.\r\n\r\nFONTOS! A csoportnak van pr egyszer szablya, az sszefoglalt errl krlek olvasd el itt: http://goo.gl/gubn5\r\n\r\nVan egy levlistnk is, ahol beszlgetnk: hegelidialektika@googlegroups.com\r\nFeliratkozni itt lehet: https://groups.google.com/d/forum/hegelidialektika\r\nAki pedig rajta van a levlistn, az tudja szerkeszteni a naptrunkat: http://goo.gl/58oVj','Budapest','2012-09-03 08:53:55','2013-01-13 14:15:56',36,'hegeli-dialektika','220px-Hegel.jpg',11153,'image/jpeg',1,'2012-09-03 09:17:16','','','',1,8,'2012-10-30 14:32:45',101221,'image/jpeg','2833735888_44b9d9c481_b.jpg',8,'hegeli-dialektika',''),(31,'Pilvax','Szerdnknt sszejvnk s alkotunk.','','2012-10-09 09:18:41','2012-10-24 18:05:40',2,'pilvax','pilvaxlogoV2.png',76228,'image/png',1,'2012-10-24 18:05:40','','','',3,NULL,'2012-10-15 09:29:15',21365,'image/png','pilvaxlogo.png',5,NULL,NULL),(32,'Startup & Vllalkozs VndorMeetup','Sikeres vllalkozk s a magyar startup koszisztma szerepli osztjk meg a tapasztalataikat s meslnek arrl, hogy mivel jr vllalkoznak vagy startuppernek lenni.\r\n\r\nAzon trd a fejed, hogy vllalkozst indts, vagy akr mr vllalkoz vagy?\r\nVrod a nagy tletet, vagy akr mr munklkodsz is rajta?\r\nTricsillirdos akarsz lenni, vagy pp jobb akarod tenni a vilgot?\r\nTech szaki vagy s kne mg valaki, aki rt az zlethez vagy a dizjnhoz?\r\n','Budapest','2012-10-24 13:50:39','2012-11-16 12:16:29',2,'startup-vallalkozas-vandormeetup','Lightbulb2.jpg',221265,'image/jpeg',0,'2012-11-13 13:48:06','','','',1,8,NULL,NULL,NULL,NULL,45,'startup-vallalkozas-vandormeetup',NULL),(33,'Short Swords and Laser Beams','A fun, eclectic role-playing group. Currently running a zombie rpg with an original system, and a superhero campaign that uses Hero 8 (a free system, available online).','','2012-11-16 05:31:09','2012-11-16 05:31:09',228,'short-swords-and-laser-beams','dapper.jpg',69366,'image/jpeg',0,'2012-11-16 05:31:07','','','',3,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL),(34,'Jakarta Clubbing & Meet New Friends','Jakarta Clubbing & Meet New Friends','Jakarta','2012-11-19 02:46:05','2012-11-20 10:52:12',242,'jakarta_clubbing',NULL,NULL,NULL,0,NULL,'','','',3,84,NULL,NULL,NULL,NULL,1,'Jakarta_clubbing',NULL),(35,'Lothian Cyclists','test','','2012-11-19 13:20:09','2012-11-19 13:20:09',251,'lothiancyclists',NULL,NULL,NULL,0,NULL,'','','',3,NULL,NULL,NULL,NULL,NULL,1,'lothiancyclists',NULL),(36,'nyilvnosan is frappnsan :)','Tanuljunk egytt beszlni, killni, eladni...spontnul s felkszlten, hogy minden helyzetben biztonsggal s felszabadultan llhassuk meg a helynk. Mert az hasznos. s fleg, mert izgalmas s mks. Minl tbben vagyunk, annl inkbb :).\r\nRgtnzs, vitakultra, retorika, testbeszd... eladkkal vagy nkpzen...rakjuk ssze egytt! :)','megbeszls trgya, amgy minden ms is az :)','2012-11-28 13:25:31','2012-11-28 13:25:31',263,'nyilvanosan-is-frappansan','frog-speech.jpg',74224,'image/jpeg',0,'2012-11-28 13:25:30','','','',NULL,233,'2012-11-28 13:25:28',16106,'image/jpeg','SpeechStreetLogo.jpg',5,'nyilvanosbeszed',NULL),(37,'willamette river maidens','gathering of queer (and other) femmes in and near the northern Willamette Valley region including Portland.','','2012-12-05 00:34:27','2012-12-05 00:34:27',268,'willamette-river-maidens',NULL,NULL,NULL,0,NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,1,'wrmfemmepdx',NULL),(38,'splendid femmes! (portland, oregon)','mostly a group of (mostly) queer femmes together for all sorts of things that are lovely, fun, affirming, empowering, and nurturing.','Portland, Oregon, USA','2012-12-06 06:48:20','2012-12-06 06:48:20',271,'splendid-femmes-portland-oregon','Lovely_Femme.jpg',38554,'image/jpeg',0,'2012-12-06 06:48:18','','','',3,240,NULL,NULL,NULL,NULL,1,'',NULL),(39,'Lean Test','','','2012-12-13 01:57:22','2012-12-13 01:57:22',276,'lean-test',NULL,NULL,NULL,0,NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,1,'lean-test',''),(40,'The Family Circle','This group is mainly for Pagan families with children -- It is often hard to find opportunities in this area for family/child-friendly Pagan events outside of festivals! This group hopes to have regular rituals, recipe shares, drum circles, fire circles, nature walks, herb lore, Goddess and God lessons spanning all cultures... Eventually be able to have some sort of \"craft school\" for the kids... Pagans/Witches of any age are welcome to join the group, but the focus is on families with children, or couples who wish to have children -- A chance to build a community with other families that share similar spirituality and faith.','USA, Maryland, Laurel','2012-12-13 14:13:57','2012-12-13 14:16:52',273,'the-family-circle','family_circle_photo.jpg',17516,'image/jpeg',0,'2012-12-13 14:13:57','https://www.facebook.com/groups/343420385731281/','','',2,247,NULL,NULL,NULL,NULL,2,'groups-the-family-circle',''),(41,'Polish Unity User Group','Polish Unity User Group','Warsaw','2012-12-20 09:04:17','2012-12-20 09:04:17',283,'polish-unity-user-group',NULL,NULL,NULL,0,NULL,'','','',2,252,NULL,NULL,NULL,NULL,1,'',''),(43,'Hogar del nio: San Vicente de Paul','','San Salvador','2013-01-01 12:59:21','2013-01-01 13:01:22',291,'hogar-del-nino-san-vicente-de-paul','6034920_700b_v1.jpg',159479,'image/jpeg',0,'2013-01-01 13:01:21','','','',2,154,'2013-01-01 13:01:19',1064916,'image/png','FOO.PNG',1,'',''),(44,'Interfaith Solidarity Cascadia','People of many diverse spiritual traditions coming together to rebuild broken communities and to restore the peoples, while providing spiritual support and faith-based wisdom to the community organizers in the Pacific Northwest.','Portland, Oregon','2013-01-02 06:46:25','2013-01-02 06:46:25',268,'interfaith-solidarity-cascadia',NULL,NULL,NULL,0,NULL,'','','',NULL,259,NULL,NULL,NULL,NULL,1,'pdxintersol',''),(45,'Barcelona.pm','Perl mongers near Barcelona meet the last thursday of the month to socialize with an ocassional technical talk','Barcelona','2013-01-02 15:00:02','2013-01-02 15:00:02',292,'barcelona-pm',NULL,NULL,NULL,0,NULL,'','http://barcelona.pm','',NULL,260,NULL,NULL,NULL,NULL,1,'barcelona-pm',''),(46,'Bellingham Sufis','Sufism is a path of the heart. It is designed to turn us back to the deepest truth of who we are. \r\n\r\nThe word for \"heart\" in Arabic is a verb. It means \"to turn.\"\r\n\r\nIn our everyday lives, our hearts get turned to those things that need our immediate attention, such as our jobs, our children, our spouses, our problems and worries. Sufism is about helping people turn their hearts back to the deeper truth of their connection to everyone and everything. \r\n\r\nGod\'s endless love and compassion is there all the time for each of us. All we have to do is turn our hearts back. If your heart is wanting to know and touch the reality of God, join us for weekly dhikr, which is a form of Sufi practice (on Sunday nights at 7:00 p.m.) and/or for classes that are held from time to time. \r\n\r\nA particularly amazing teacher is coming to Bellingham to offer a weekend workshop. For additional information, visit this link: http://washingtonsufis.org/your-heart-was-made-to-love/\r\n\r\nFor more information about Sufism and our activities, contact Latifa at (360) 306-6250 or Hasan at (360) 595-7400. Thanks. \r\n','Bellingham, Washington','2013-01-06 23:35:13','2013-01-06 23:35:13',298,'bellingham-sufis','Sufi.jpg',6271,'image/jpeg',0,'2013-01-06 23:35:09','','','',2,267,NULL,NULL,NULL,NULL,1,'','Thanks for joining our group. You are welcome to join us for dhikr most any Sunday night at 7:00 p.m., but call in advance if it\'s your first time just to make sure we haven\'t taken the week off. Please contact Latifa at (360) 306-6250 or Hasan at (360) 595-7400. '),(47,'stitch and bitch','essai','Montreal','2013-01-10 04:51:49','2013-01-10 04:51:49',303,'stitch-and-bitch',NULL,NULL,NULL,1,NULL,'','','',NULL,20,NULL,NULL,NULL,NULL,1,'stitchandbitch','essai'),(48,'stitch and bitch','essai','Montreal','2013-01-10 04:52:30','2013-01-10 04:52:30',303,'stitch-and-bitch-2',NULL,NULL,NULL,1,NULL,'','','',NULL,20,NULL,NULL,NULL,NULL,1,'stitchandbitchmontreal','essai');
